import React, { Component } from 'react'


const QuestionBox = (props) => {
    console.log(props.currentQuestion)
    return (
        <div key={props.currentQuestion.id}>{props.currentQuestion.question} 
        <ol type='A'>
            <li>{props.currentQuestion.option1}</li>
            <li>{props.currentQuestion.option2}</li>
            <li>{props.currentQuestion.option3}</li>
            <li>{props.currentQuestion.option4}</li>

        </ol>
    </div>
    )
}

export default QuestionBox
